<p>
<p>–ê —è–∫—â–æ –≤–∏ –Ω–µ –∑–Ω–∞—î—Ç–µ, —á–æ–≥–æ —Å–∞–º–µ —Ö–æ—á–µ—Ç–µ —Å—å–æ–≥–æ–¥–Ω—ñ, –ø–æ—á–Ω—ñ—Ç—å –≤–µ—á—ñ—Ä –∑ —Ä–æ–∑—Å–ª–∞–±–ª—è—é—á–æ–≥–æ –º–∞—Å–∞–∂—É, –ø—ñ–¥ —á–∞—Å —è–∫–æ–≥–æ –Ω–∞—à—ñ –¥—ñ–≤—á–∞—Ç–∞ —Ä–æ–∑–∫–∞–∂—É—Ç—å –ø—Ä–æ —Å–≤–æ—ó —Ç–∞–ª–∞–Ω—Ç–∏. –ü–æ–≤—ñ—Ä—Ç–µ, –ø—ñ—Å–ª—è —Ç–∞–∫–æ—ó —Ä–æ–∑–º–æ–≤–∏ –æ–¥–Ω—ñ—î—ó –≥–æ–¥–∏–Ω–∏ —Å–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è –≤–∞–º —Ç–æ—á–Ω–æ –±—É–¥–µ –º–∞–ª–æ. –ü–∞–º'—è—Ç–∞–π—Ç–µ –ø—Ä–æ —Ç–µ, —â–æ –∑–∞–º–æ–≤–∏—Ç–∏ –ø–æ–≤—ñ—é –Ω–∞ –Ω—ñ—á –æ–±—ñ–π–¥–µ—Ç—å—Å—è –¥–µ—à–µ–≤—à–µ, –Ω—ñ–∂ —Ä–æ–±–∏—Ç–∏ –∑–∞–º–æ–≤–ª–µ–Ω–Ω—è –∫—ñ–ª—å–∫–∞ —Ä–∞–∑—ñ–≤. –î–ª—è –ª—é–±–∏—Ç–µ–ª—ñ–≤ –≤–µ–ª–∏–∫–∏—Ö –ø–æ—Ä—Ü—ñ–π –∑–∞ –º–∞–ª—ñ –≥—Ä–æ—à—ñ, –Ω–∞ —Å–∞–π—Ç—ñ —î –º–æ–∂–ª–∏–≤—ñ—Å—Ç—å –ø–æ—à—É–∫—É –ø–æ–¥—Ä—É–∂–æ–∫. –ë—ñ–ª—å—à–µ, –Ω—ñ–∂ —Ö–æ—Ä–æ—à–∏–π —Å–µ–∫—Å, –ø–æ–≤—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ –ª—é–±–ª—è—Ç—å –≤—ñ–¥–º—ñ–Ω–Ω–∏–π —Å–µ–∫—Å —É –≤–µ–ª–∏–∫—ñ–π –∫–æ–º–ø–∞–Ω—ñ—ó! –°–∏–ª—å–Ω–∞ —Å—Ç–æ—Ä–æ–Ω–∞ –Ω–∞—à–æ–≥–æ –ø—Ä–æ–µ–∫—Ç—É - —Å–µ—Ä–≤—ñ—Å –Ω–∞–π–≤–∏—â–æ—ó —è–∫–æ—Å—Ç—ñ. –í–∏ –º–æ–∂–µ—Ç–µ –±—É—Ç–∏ –≤–ø–µ–≤–Ω–µ–Ω—ñ, —â–æ —Ç—ñ–ª—å–∫–∏ –ø—Ä–æ—Ñ–µ—Å—ñ–π–Ω—ñ –ø—Ä–æ—Å—Ç—ñ—Ç—É—Ç–∫–∏ –£–∫—Ä–∞—ó–Ω–∏ –∑—ñ–±—Ä–∞–Ω—ñ —É –Ω–∞—Å.</p>
<p>–°–µ—Ä–µ–¥ —ó—Ö–Ω—ñ—Ö –∞–Ω–∫–µ—Ç –Ω–µ–º–∞—î –∂–æ–¥–Ω–æ—ó –≤–∏–≥–∞–¥–∞–Ω–æ—ó –∞–±–æ –ø—Ä–∏–∫—Ä–∞—à–µ–Ω–æ—é, –∞ –∫—Ä—ñ–º —Ç–æ–≥–æ, —É –∫–æ–∂–Ω–æ—ó –¥—ñ–≤—á–∏–Ω–∏ —î –ø—Ä–æ—Ñ–µ—Å—ñ–π–Ω–∏–π —Ñ–æ—Ç–æ—Å–µ—Ç, –¥–µ –≤–∏ –∑–º–æ–∂–µ—Ç–µ –≥–∞—Ä–Ω–µ–Ω—å–∫–æ —Ä–æ–∑–≥–ª—è–Ω—É—Ç–∏ —ó—ó, —ñ –¥–æ–∫–ª–∞–¥–Ω–∏–π —Å–ø–∏—Å–æ–∫ —Ç–æ–≥–æ, —á–∏–º –≤–æ–Ω–∞ –±—É–ª–∞ –± –Ω–µ –ø—Ä–æ—Ç–∏ –∑–∞–π–Ω—è—Ç–∏—Å—è –∑ –≤–∞–º–∏, –∞ —á–∏–º –º–æ–∂–µ –ø–æ—Ä–∞–¥—É–≤–∞—Ç–∏ –≤–∞—Å —ó—ó –ø–æ–¥—Ä—É–∂–∫–∞. –î–æ–∫–ª–∞–¥–Ω—ñ –∞–Ω–∫–µ—Ç–∏ - —â–µ –æ–¥–Ω–∞ –ø–µ—Ä–µ–≤–∞–≥–∞ –Ω–∞—à–æ–≥–æ –ø—Ä–æ–µ–∫—Ç—É. –©–æ–± –¥–æ–ø–æ–º–æ–≥—Ç–∏ –≤–∞–º —É–Ω–∏–∫–Ω—É—Ç–∏ —Ä–æ–∑—á–∞—Ä—É–≤–∞–Ω–Ω—è –≤—ñ–¥ –Ω–µ–≤–¥–∞–ª–æ–≥–æ –≤–µ—á–æ—Ä–∞, –º–∏ —Ä–µ—Ç–µ–ª—å–Ω–æ –æ–±—Ä–æ–±–ª—è—î–º–æ –∫–æ–∂–Ω—É –æ—Å–æ–±–∏—Å—Ç—É —Å—Ç–æ—Ä—ñ–Ω–∫—É –¥—ñ–≤—á–∞—Ç. –¢–æ–º—É –≤–∏ –º–æ–∂–µ—Ç–µ –±—É—Ç–∏ –≤–ø–µ–≤–Ω–µ–Ω—ñ, —â–æ –¥–æ–∑–≤—ñ–ª–ª—è –ø—Ä–æ–π–¥–µ —Å–∞–º–µ —Ç–∞–∫, —è–∫ –≤–∏ –∑–∞–ø–ª–∞–Ω—É–≤–∞–ª–∏. –û–±—Ä–∞–∑–Ω–æ –∫–∞–∂—É—á–∏, –ø–æ–≤—ñ—ó –Ω–∞ –Ω–∞—à–æ–º—É –ø–æ—Ä—Ç–∞–ª—ñ –Ω–µ —Å—Ç—Ä–∞–∂–¥–∞—é—Ç—å —Ä–∞–ø—Ç–æ–≤–∏–º–∏ –Ω–∞–ø–∞–¥–∞–º–∏ –≥–æ–ª–æ–≤–Ω–æ–≥–æ –±–æ–ª—é, –Ω–µ –≤–µ—Ä–µ–¥—É—é—Ç—å —ñ –Ω–µ –π–¥—É—Ç—å –∑ –≤–µ—á—ñ—Ä–∫–∏ –≤ —Å–∞–º–∏–π —ó—ó —Ä–æ–∑–ø–∞–ª.</p>
<p>–ê —è–∫—â–æ —ñ —Ç—Ä–∞–ø–ª—è—é—Ç—å—Å—è —è–∫—ñ—Å—å —Å—é—Ä–ø—Ä–∏–∑–∏, —Ç–æ –≤–∏–∫–ª—é—á–Ω–æ –ø—Ä–∏—î–º–Ω—ñ. –ù–∞ —Å–∞–π—Ç—ñ ¬†—Ç–∞–∫–æ–∂ –¥—ñ—î —Ñ–æ—Ä—É–º, –¥–µ –∑–∞–≤—Å—ñ–¥–Ω–∏–∫–∏ –¥—ñ–ª—è—Ç—å—Å—è —Å–≤–æ—ó–º–∏ –≤—Ä–∞–∂–µ–Ω–Ω—è–º–∏, —Ç–∞–∫ —â–æ —à–∞–Ω—Å–∏ –¥–∞—Ä–µ–º–Ω–æ –≤—Ç—Ä–∞—Ç–∏—Ç–∏ —á–∞—Å —ñ –≥—Ä–æ—à—ñ, –∫–æ—Ä–∏—Å—Ç—É—é—á–∏—Å—å –Ω–∞—à–∏–º–∏ –ø–æ—Å–ª—É–≥–∞–º–∏, –ø—Ä–∞–≥–Ω—É—Ç—å –¥–æ –Ω—É–ª—è. –ü—Ä–∏—î–º–Ω–∞ –æ—Å–æ–±–ª–∏–≤—ñ—Å—Ç—å –Ω–∞—à–æ–≥–æ –ø–æ—Ä—Ç–∞–ª—É - —Ä—ñ–∑–Ω–æ–º–∞–Ω—ñ—Ç–Ω—ñ—Å—Ç—å –ø–æ—Å—Ç—ñ–π–Ω–æ –æ–Ω–æ–≤–ª—é–≤–∞–Ω–∏—Ö –∞–Ω–∫–µ—Ç.</p>
<p>–ù–∞—à—ñ –∫–ª—ñ—î–Ω—Ç–∏ –º–æ–∂—É—Ç—å –∑–Ω–∞—Ö–æ–¥–∏—Ç–∏ –≤–ø–æ–¥–æ–±–∞–Ω–∏—Ö —ó–º –¥—ñ–≤—á–∞—Ç –Ω–∞ —ñ–º'—è —ñ –Ω–∞–Ω–æ—Å–∏—Ç–∏ —ó–º –≤—ñ–∑–∏—Ç–∏ –∑–Ω–æ–≤—É —ñ –∑–Ω–æ–≤—É, –∞ –º–æ–∂—É—Ç—å –≤—ñ–¥—Å—Ç–µ–∂—É–≤–∞—Ç–∏ –ø–æ—è–≤—É –Ω–æ–≤–µ–Ω—å–∫–∏—Ö –¥—ñ–≤—á–∞—Ç —ñ –æ—Å–≤—ñ–∂–∞—Ç–∏ —Å–≤–æ—î –¥–æ–∑–≤—ñ–ª–ª—è. –í—Å–µ —â–µ —Å—É–º—É—î—Ç–µ –Ω–∞ —Å–∞–º–æ—Ç—ñ? –ó—Ä–æ–±—ñ—Ç—å —Ç—Ä–∏ –∫—Ä–æ–∫–∏ –Ω–∞ —à–ª—è—Ö—É –¥–æ —Ö–æ—Ä–æ—à–æ–≥–æ –¥–æ–∑–≤—ñ–ª–ª—é: –≤–∏–±–µ—Ä—ñ—Ç—å, –∑–∞—Ç–µ–ª–µ—Ñ–æ–Ω—É–π—Ç–µ —ñ —Ä–æ–∑—Å–ª–∞–±—Ç–µ—Å—è! –ï—Ä–æ—Ç–∏—á–Ω—ñ —Ñ–∞–Ω—Ç–∞–∑—ñ—ó –≤–ª–∞—Å—Ç–∏–≤—ñ –∫–æ–∂–Ω—ñ–π. –Ü –≤ –Ω–∏—Ö –Ω–µ–º–∞—î –º—ñ—Å—Ü—è –±–∞–Ω–∞–ª—å–Ω–æ—Å—Ç—ñ.</p>
<p>–ß–æ–ª–æ–≤—ñ–∫ –±–∞—á–∏—Ç—å —Å–µ–±–µ –≤ –Ω–∏—Ö —Å–∏–ª—å–Ω–∏–º, —Å–µ–∫—Å—É–∞–ª—å–Ω–∏–º, –±–∞–∂–∞–Ω–∏–º –≤ –æ—Ç–æ—á–µ–Ω–Ω—ñ –æ–≥–æ–ª–µ–Ω–∏—Ö –∂—ñ–Ω–æ–∫. –¶–∏–º –Ω–µ –æ–±–º–µ–∂—É—é—Ç—å—Å—è —Ñ–∞–Ω—Ç–∞–∑—ñ—ó, —ó–º –Ω–µ–º–∞—î –º–µ–∂. –Ü —è–∫—â–æ –≤–∏ –¥—É–º–∞—î—Ç–µ, —â–æ —ó—Ö –Ω–µ–º–æ–∂–ª–∏–≤–æ —Ä–µ–∞–ª—ñ–∑—É–≤–∞—Ç–∏, —Ç–æ –≤–∏ —Å–∏–ª—å–Ω–æ –ø–æ–º–∏–ª—è—î—Ç–µ—Å—è. –•–≤–æ–π–¥–∏ –£–∫—Ä–∞—ó–Ω–∏ ¬†—Ü–µ –∫—Ä–∞—Å–∏–≤—ñ –¥—ñ–≤—á–∞—Ç–∞, —è–∫—ñ –≤–º—ñ—é—Ç—å –ø–æ—Ä—É—à–∏—Ç–∏ –∑–∞ –∫—ñ–ª—å–∫–∞ —Å–µ–∫—É–Ω–¥ —ñ –ø–æ–∫–∞–∑–∞—Ç–∏ —è–∫–∏–º –º–∞—î –±—É—Ç–∏ —Å–ø—Ä–∞–≤–∂–Ω—ñ–π –æ—Ä–≥–∞–∑–º. –í—ñ–Ω –º–æ–∂–µ –±—É—Ç–∏ —Ç—Ä–∏–≤–∞–ª–∏–º, —Ç—è–∂–∫–∏–º, –∞–ª–µ –∑–∞–≤–∂–¥–∏ –Ω–∞ –≤–µ—Ä—à–∏–Ω—ñ –±–ª–∞–∂–µ–Ω—Å—Ç–≤–∞. –ü–æ–≤—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ ¬†—Ü–µ –ø—Ä–æ—Ñ–µ—Å—ñ–æ–Ω–∞–ª–∫–∏ —Å–≤–æ—î—ó —Å–ø—Ä–∞–≤–∏, —è–∫—ñ –∑–º–æ–∂—É—Ç—å –≤—ñ–¥—á—É—Ç–∏ —Ç–µ–º–ø–µ—Ä–∞–º–µ–Ω—Ç —á–æ–ª–æ–≤—ñ–∫–∞, –ø—ñ–¥–ª–∞—à—Ç—É–≤–∞—Ç–∏—Å—è –ø—ñ–¥ —Ä–∏—Ç–º, –∞ —ñ–Ω–æ–¥—ñ —ñ –∑–∞–¥–∞—Ç–∏ —Å–≤–æ—î, –ø—Ä–æ–±—É–¥–∂—É—é—á–∏ –ø–∞—Ä—Ç–Ω–µ—Ä–∞ –¥–æ –Ω–æ–≤–∏—Ö –ø–æ–¥–≤–∏–≥—ñ–≤.</p>
