	<p>–ó–∞–º—ñ—Å—Ç—å —Ç–æ–≥–æ, —â–æ–± —Ä–æ–∑—Ö–≤–∞–ª—é–≤–∞—Ç–∏ —Å–≤–æ—î –ø–æ—á—É—Ç—Ç—è –≥—É–º–æ—Ä—É, –∫—Ä–∞—â–µ –ø–æ–∂–∞—Ä—Ç—É–π—Ç–µ", - –ø–æ—è—Å–Ω—é—î –ø–∞–Ω—ñ –ï—Ç—Ç—ñ–Ω. –ú–æ–∂–Ω–∞ —Å–∫–∞–∑–∞—Ç–∏ –ø—Ä–æ —Å–µ–±–µ, —â–æ –≤–∏ –∫—É–º–µ–¥–Ω–∏–π, –∞–ª–µ —è–∫ —Å–∞–º–µ? –ß–∏ —Å–ø–æ–¥–æ–±–∞—î—Ç—å—Å—è –ø–æ—Ç–µ–Ω—Ü—ñ–π–Ω–æ–º—É –ø–∞—Ä—Ç–Ω–µ—Ä–æ–≤—ñ —Å–∞–º–µ —Ç–∞–∫–µ –ø–æ—á—É—Ç—Ç—è –≥—É–º–æ—Ä—É? –ú–æ–∂–Ω–∞ –Ω–∞–∑–≤–∞—Ç–∏ —Å–µ–±–µ –¥–æ–±—Ä–∏–º, –∞–ª–µ —Ü–µ –Ω—ñ—á–æ–≥–æ –Ω–µ –≤–∞—Ä—Ç–µ, –ø–æ–∫–∏ —Ç–∞ –¥–æ–±—Ä–æ—Ç–∞ –Ω–µ –ø—Ä–æ—è–≤–∏—Ç—å—Å—è. –á–π —Ç–∞–∫–æ–∂ –Ω–µ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è, –∫–æ–ª–∏ —Ä–µ—á–µ–Ω–Ω—è –ø–æ—á–∏–Ω–∞—î—Ç—å—Å—è —Å–ª–æ–≤–∞–º–∏ "–¥—Ä—É–∑—ñ –∫–∞–∂—É—Ç—å‚Ä¶". –î–æ–≥–µ—Ä—Ç—ñ –≤–≤–∞–∂–∞—î, —â–æ —Ç–∞–∫—ñ –≤–∏—Å–ª–æ–≤–∏ –∑–∞–ø–æ–∑–∏—á—É—é—Ç—å –∑ —Ä–æ–º–∞–Ω—Ç–∏—á–Ω–∏—Ö –∫–æ–º–µ–¥—ñ–π, –∫–Ω–∏–∂–æ–∫ —Ç–∞ –ø—Ä–æ—Ñ—ñ–ª—ñ–≤ —ñ–Ω—à–∏—Ö –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤: "–Ø –∑–≤–∏—á–∞–π–Ω–∞ —Å–æ–±—ñ –ª—é–¥–∏–Ω–∞", ‚Äî –æ—Å—å —â–æ –≤–∏ –≥–æ–≤–æ—Ä–∏—Ç–µ".</p>
<p>–ü–∞–Ω –Ü–Ω“ë–ª–∞–Ω–¥ –≤—ñ–¥–Ω–æ—Å–∏—Ç—å —Ü—é —Ñ—Ä–∞–∑—É –¥–æ –Ω–∞–π–º–µ–Ω—à –∑–º—ñ—Å—Ç–æ–≤–Ω–∏—Ö. –ü–æ–∫–∞–∂—ñ—Ç—å –º–µ–Ω—ñ —Ç–æ–≥–æ, —Ö—Ç–æ –Ω–µ –≤–≤–∞–∂–∞—î –¥—Ä—É–∑—ñ–≤ –≤–∞–∂–ª–∏–≤–∏–º–∏", ‚Äî –∫–∞–∂–µ –≤—ñ–Ω. –ô–æ–≥–æ –≥–æ–ª–æ–≤–Ω–∞ –¥—É–º–∫–∞: –Ω–µ —Ç—Ä–µ–±–∞ –≤—ñ–¥–Ω–æ—Å–∏—Ç–∏ –¥–æ —É–ø–æ–¥–æ–±–∞–Ω—å —Ç–µ, —â–æ –¥—É–∂–µ —Ä—ñ–¥–∫–æ –∫–æ–º—É –Ω–µ –ø–æ–¥–æ–±–∞—î—Ç—å—Å—è. –¢–∞ –Ω–µ–≤–∂–µ?! –ó–∞ —Ü–∏–º –∑–∞–∑–≤–∏—á–∞–π —ñ–¥–µ –¥–æ–∫–ª–∞–¥–Ω–∏–π –æ–ø–∏—Å —É—Å–ø—ñ—à–Ω–æ–≥–æ —ñ –∞–∫—Ç–∏–≤–Ω–æ–≥–æ –∂–∏—Ç—Ç—è, –ø–æ–≤–Ω–æ–≥–æ –¥–æ—Å—è–≥–Ω–µ–Ω—å —ñ –º–∞–Ω–¥—Ä—ñ–≤ –ø–æ –≤—Å—å–æ–º—É —Å–≤—ñ—Ç–æ–≤—ñ.</p><strong><a id='z3'></a><h2>–ò–Ω—Ç–∏–º (–°–µ–∫—Å) –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ë–æ–±—Ä–∏–Ω–µ—Ü</h2></strong><p>–î–æ–≥–µ—Ä—Ç—ñ –ø–æ—è—Å–Ω—é—î, —â–æ –∑–∞ —Ü–∏–º —Å—Ç–æ—ó—Ç—å –≤–∂–µ –∑–Ω–∞–π–æ–º–∏–π –∑–º—ñ—Å—Ç: "–Ø –Ω–µ —É –≤—ñ–¥—á–∞—ó, –Ω–µ –≤–∏–ø—Ä–æ—à—É—é —É–≤–∞–≥–∏, –Ω–µ —Å–∞–º–æ—Ç–Ω—ñ–π. –Ø ‚Äî –¥—É–∂–µ —â–∞—Å–ª–∏–≤–∞ —ñ –ø–æ–≤–Ω–æ—Ü—ñ–Ω–Ω–∞ –ª—é–¥–∏–Ω–∞. –ú–æ—î –∂–∏—Ç—Ç—è –≤–∂–µ —ñ —Ç–∞–∫ –±–∞–≥–∞—Ç–µ, –∞ –≤–∏ –º–æ–∂–µ—Ç–µ —Å—Ç–∞—Ç–∏ –ø—Ä–µ–∫—Ä–∞—Å–Ω–∏–º –¥–æ–¥–∞—Ç–∫–æ–º". –ê–±–æ —â–µ –æ–¥–∏–Ω "–ø–µ—Ä–µ–∫–ª–∞–¥": "–¢–µ, —â–æ —è —Ç—É—Ç, –Ω–∞ —Ü—å–æ–º—É —Å–∞–π—Ç—ñ, –Ω–µ –æ–∑–Ω–∞—á–∞—î, —â–æ —è –Ω–∞–º–∞–≥–∞—é—Å—è –∑–∞–ø–æ–≤–Ω–∏—Ç–∏ –≤–Ω—É—Ç—Ä—ñ—à–Ω—é –ø–æ—Ä–æ–∂–Ω–µ—á—É".</p>
</p>
